import React from "react";
import "../components/styles.css";

const LoginForm = () => (
  <div className="signInFormContainer">
    <form>
      <input type="text" placeholder="userName" />
      <input type="password" placeholder="password" />
    </form>
    <button>Login</button>
  </div>
);

export default LoginForm;
